import React from 'react';
import { ITab } from '../../../data/tabs';
import { Content } from './styles';

const Tab: React.FC<{ tab: ITab }> = ({ tab }) => {
  return (
    <Content background={tab.icon ? tab.icon : ''}>
      <div>
        <h3>{tab.title}</h3>
        <p>{tab.text}</p>
      </div>
    </Content>
  )
};

export default Tab;
